contracts/StorageOracle.sol.content:
// SPDX-License-Identifier: MIT
pragma solidity ^0.8.27;

import "@openzeppelin/contracts/access/AccessControl.sol";
import "@openzeppelin/contracts/utils/ReentrancyGuard.sol";

/**
 * @title StorageOracle
 * @dev Tracks data distribution and availability across 0G Storage nodes
 * Provides integrity verification and redundancy management
 */
contract StorageOracle is AccessControl, ReentrancyGuard {
    bytes32 public constant ORACLE_ROLE = keccak256("ORACLE_ROLE");
    bytes32 public constant ADMIN_ROLE = keccak256("ADMIN_ROLE");

    struct StorageEntry {
        string root; // 0G Storage root hash
        string[] nodeAddresses; // Storage nodes holding the data
        uint256 size; // Data size in bytes
        uint256 replicationFactor; // Number of replicas
        uint256 timestamp; // Last update timestamp
        bool isActive; // Whether the data is actively stored
        bytes32 integrityHash; // Hash for integrity verification
    }

    struct StorageNode {
        string nodeAddress;
        uint256 totalStorage; // Total storage capacity
        uint256 usedStorage; // Used storage
        uint256 reliability; // Reliability score (0-100)
        uint256 lastSeen; // Last heartbeat timestamp
        bool isActive; // Whether the node is active
    }

    struct ReplicationRequest {
        string root;
        uint256 targetReplicas;
        uint256 currentReplicas;
        uint256 requestTime;
        bool fulfilled;
    }

    // Storage
    mapping(string => StorageEntry) public storageEntries;
    mapping(string => StorageNode) public storageNodes;
    mapping(string => ReplicationRequest) public replicationRequests;

    string[] public activeRoots;
    string[] public activeNodes;
    mapping(string => string[]) public nodeDataMap; // node -> roots

    uint256 public totalStoredData;
    uint256 public totalActiveNodes;
    uint256 public minReplicationFactor = 3;

    // Events
    event DataStored(
        string indexed root,
        string[] nodeAddresses,
        uint256 size,
        uint256 replicationFactor
    );

    event DataRemoved(
        string indexed root,
        uint256 size
    );

    event NodeRegistered(
        string indexed nodeAddress,
        uint256 totalStorage
    );

    event NodeUpdated(
        string indexed nodeAddress,
        uint256 usedStorage,
        uint256 reliability
    );

    event NodeDeactivated(
        string indexed nodeAddress
    );

    event ReplicationRequested(
        string indexed root,
        uint256 targetReplicas
    );

    event ReplicationCompleted(
        string indexed root,
        uint256 newReplicationFactor
    );

    event IntegrityViolation(
        string indexed root,
        string indexed nodeAddress,
        bytes32 expectedHash,
        bytes32 actualHash
    );

    constructor() {
        _grantRole(DEFAULT_ADMIN_ROLE, msg.sender);
        _grantRole(ADMIN_ROLE, msg.sender);
        _grantRole(ORACLE_ROLE, msg.sender);
    }

    modifier onlyOracle() {
        require(hasRole(ORACLE_ROLE, msg.sender), "StorageOracle: Oracle role required");
        _;
    }

    modifier onlyAdmin() {
        require(hasRole(ADMIN_ROLE, msg.sender), "StorageOracle: Admin role required");
        _;
    }

    /**
     * @dev Register data storage across 0G nodes
     * @param root 0G Storage root hash
     * @param nodeAddresses Array of node addresses storing the data
     * @param size Data size in bytes
     * @param integrityHash Hash for integrity verification
     */
    function registerDataStorage(
        string memory root,
        string[] memory nodeAddresses,
        uint256 size,
        bytes32 integrityHash
    ) external onlyOracle nonReentrant {
        require(bytes(root).length > 0, "StorageOracle: Invalid root hash");
        require(nodeAddresses.length > 0, "StorageOracle: No storage nodes provided");
        require(size > 0, "StorageOracle: Invalid size");

        StorageEntry storage entry = storageEntries[root];

        if (!entry.isActive) {
            activeRoots.push(root);
            totalStoredData += size;
        } else {
            // Update existing entry
            totalStoredData = totalStoredData - (entry.size) + size;
        }

        entry.root = root;
        entry.nodeAddresses = nodeAddresses;
        entry.size = size;
        entry.replicationFactor = nodeAddresses.length;
        entry.timestamp = block.timestamp;
        entry.isActive = true;
        entry.integrityHash = integrityHash;

        // Update node data mappings
        for (uint256 i = 0; i < nodeAddresses.length; i++) {
            _addDataToNode(nodeAddresses[i], root);
            _updateNodeUsage(nodeAddresses[i], size, true);
        }

        emit DataStored(root, nodeAddresses, size, nodeAddresses.length);

        // Check if replication is sufficient
        if (nodeAddresses.length < minReplicationFactor) {
            _requestReplication(root, minReplicationFactor);
        }
    }

    /**
     * @dev Remove data storage entry
     * @param root 0G Storage root hash
     */
    function removeDataStorage(string memory root) external onlyOracle nonReentrant {
        StorageEntry storage entry = storageEntries[root];
        require(entry.isActive, "StorageOracle: Data not found or already removed");

        // Update node usage
        for (uint256 i = 0; i < entry.nodeAddresses.length; i++) {
            _updateNodeUsage(entry.nodeAddresses[i], entry.size, false);
            _removeDataFromNode(entry.nodeAddresses[i], root);
        }

        totalStoredData -= entry.size;
        entry.isActive = false;

        emit DataRemoved(root, entry.size);
    }

    /**
     * @dev Register a new storage node
     * @param nodeAddress Node address/identifier
     * @param totalStorage Total storage capacity
     */
    function registerNode(
        string memory nodeAddress,
        uint256 totalStorage
    ) external onlyOracle {
        require(bytes(nodeAddress).length > 0, "StorageOracle: Invalid node address");
        require(totalStorage > 0, "StorageOracle: Invalid storage capacity");

        StorageNode storage node = storageNodes[nodeAddress];

        if (!node.isActive) {
            activeNodes.push(nodeAddress);
            totalActiveNodes++;
        }

        node.nodeAddress = nodeAddress;
        node.totalStorage = totalStorage;
        node.usedStorage = 0;
        node.reliability = 100; // Start with perfect reliability
        node.lastSeen = block.timestamp;
        node.isActive = true;

        emit NodeRegistered(nodeAddress, totalStorage);
    }

    /**
     * @dev Update node status and metrics
     * @param nodeAddress Node address
     * @param usedStorage Current used storage
     * @param reliability Reliability score (0-100)
     */
    function updateNodeStatus(
        string memory nodeAddress,
        uint256 usedStorage,
        uint256 reliability
    ) external onlyOracle {
        StorageNode storage node = storageNodes[nodeAddress];
        require(node.isActive, "StorageOracle: Node not found or inactive");
        require(reliability <= 100, "StorageOracle: Invalid reliability score");

        node.usedStorage = usedStorage;
        node.reliability = reliability;
        node.lastSeen = block.timestamp;

        emit NodeUpdated(nodeAddress, usedStorage, reliability);
    }

    /**
     * @dev Deactivate a storage node
     * @param nodeAddress Node address
     */
    function deactivateNode(string memory nodeAddress) external onlyOracle {
        StorageNode storage node = storageNodes[nodeAddress];
        require(node.isActive, "StorageOracle: Node not found or already inactive");

        node.isActive = false;
        totalActiveNodes--;

        emit NodeDeactivated(nodeAddress);

        // Check replication for all data on this node
        string[] storage nodeData = nodeDataMap[nodeAddress];
        for (uint256 i = 0; i < nodeData.length; i++) {
            _checkReplication(nodeData[i]);
        }
    }

    /**
     * @dev Verify data integrity
     * @param root 0G Storage root hash
     * @param nodeAddress Node address
     * @param actualHash Actual hash from verification
     */
    function verifyIntegrity(
        string memory root,
        string memory nodeAddress,
        bytes32 actualHash
    ) external onlyOracle {
        StorageEntry storage entry = storageEntries[root];
        require(entry.isActive, "StorageOracle: Data not found");

        if (actualHash != entry.integrityHash) {
            emit IntegrityViolation(root, nodeAddress, entry.integrityHash, actualHash);

            // Reduce node reliability
            StorageNode storage node = storageNodes[nodeAddress];
            if (node.reliability > 10) {
                node.reliability -= 10;
            }
        }
    }

    /**
     * @dev Request data replication
     * @param root 0G Storage root hash
     * @param targetReplicas Target number of replicas
     */
    function requestReplication(
        string memory root,
        uint256 targetReplicas
    ) external onlyOracle {
        require(targetReplicas >= minReplicationFactor, "StorageOracle: Below minimum replication");
        _requestReplication(root, targetReplicas);
    }

    /**
     * @dev Complete replication request
     * @param root 0G Storage root hash
     * @param newNodeAddresses Updated array of node addresses
     */
    function completeReplication(
        string memory root,
        string[] memory newNodeAddresses
    ) external onlyOracle {
        StorageEntry storage entry = storageEntries[root];
        require(entry.isActive, "StorageOracle: Data not found");

        ReplicationRequest storage request = replicationRequests[root];
        require(!request.fulfilled, "StorageOracle: Replication already completed");

        // Update storage entry
        entry.nodeAddresses = newNodeAddresses;
        entry.replicationFactor = newNodeAddresses.length;
        entry.timestamp = block.timestamp;

        // Mark request as fulfilled
        request.fulfilled = true;

        emit ReplicationCompleted(root, newNodeAddresses.length);
    }

    // View functions

    /**
     * @dev Get storage entry information
     */
    function getStorageEntry(string memory root)
        external
        view
        returns (StorageEntry memory)
    {
        return storageEntries[root];
    }

    /**
     * @dev Get storage node information
     */
    function getStorageNode(string memory nodeAddress)
        external
        view
        returns (StorageNode memory)
    {
        return storageNodes[nodeAddress];
    }

    /**
     * @dev Get all active roots
     */
    function getActiveRoots() external view returns (string[] memory) {
        return activeRoots;
    }

    /**
     * @dev Get all active nodes
     */
    function getActiveNodes() external view returns (string[] memory) {
        return activeNodes;
    }

    /**
     * @dev Check if data has sufficient replication
     */
    function hasSufficientReplication(string memory root) external view returns (bool) {
        return storageEntries[root].replicationFactor >= minReplicationFactor;
    }

    /**
     * @dev Get storage statistics
     */
    function getStorageStats()
        external
        view
        returns (uint256, uint256, uint256, uint256)
    {
        return (totalStoredData, totalActiveNodes, activeRoots.length, minReplicationFactor);
    }

    // Internal functions

    function _addDataToNode(string memory nodeAddress, string memory root) internal {
        nodeDataMap[nodeAddress].push(root);
    }

    function _removeDataFromNode(string memory nodeAddress, string memory root) internal {
        string[] storage nodeData = nodeDataMap[nodeAddress];
        for (uint256 i = 0; i < nodeData.length; i++) {
            if (keccak256(bytes(nodeData[i])) == keccak256(bytes(root))) {
                nodeData[i] = nodeData[nodeData.length - 1];
                nodeData.pop();
                break;
            }
        }
    }

    function _updateNodeUsage(
        string memory nodeAddress,
        uint256 dataSize,
        bool isAddition
    ) internal {
        StorageNode storage node = storageNodes[nodeAddress];
        if (isAddition) {
            node.usedStorage += dataSize;
        } else if (node.usedStorage >= dataSize) {
            node.usedStorage -= dataSize;
        }
    }

    function _requestReplication(string memory root, uint256 targetReplicas) internal {
        StorageEntry storage entry = storageEntries[root];

        replicationRequests[root] = ReplicationRequest({
            root: root,
            targetReplicas: targetReplicas,
            currentReplicas: entry.replicationFactor,
            requestTime: block.timestamp,
            fulfilled: false
        });

        emit ReplicationRequested(root, targetReplicas);
    }

    function _checkReplication(string memory root) internal {
        StorageEntry storage entry = storageEntries[root];
        if (entry.isActive && entry.replicationFactor < minReplicationFactor) {
            _requestReplication(root, minReplicationFactor);
        }
    }

    // Admin functions

    /**
     * @dev Set minimum replication factor
     */
    function setMinReplicationFactor(uint256 newMinReplication) external onlyAdmin {
        require(newMinReplication > 0, "StorageOracle: Invalid replication factor");
        minReplicationFactor = newMinReplication;
    }

    /**
     * @dev Grant oracle role
     */
    function grantOracleRole(address oracle) external onlyAdmin {
        _grantRole(ORACLE_ROLE, oracle);
    }

    /**
     * @dev Revoke oracle role
     */
    function revokeOracleRole(address oracle) external onlyAdmin {
        _revokeRole(ORACLE_ROLE, oracle);
    }
}

contracts/VectorRegistry.sol.content:
// SPDX-License-Identifier: MIT
pragma solidity ^0.8.27;

import "@openzeppelin/contracts/access/AccessControl.sol";
import "@openzeppelin/contracts/utils/ReentrancyGuard.sol";
import "@openzeppelin/contracts/utils/Pausable.sol";

/**
 * @title VectorRegistry
 * @dev Smart contract for managing vector collections and metadata on 0G Chain
 * Provides decentralized governance and access control for vector database operations
 */
contract VectorRegistry is AccessControl, ReentrancyGuard, Pausable {
    bytes32 public constant ADMIN_ROLE = keccak256("ADMIN_ROLE");
    bytes32 public constant OPERATOR_ROLE = keccak256("OPERATOR_ROLE");
    bytes32 public constant USER_ROLE = keccak256("USER_ROLE");

    struct Collection {
        string name;
        string description;
        uint256 dimension;
        uint256 vectorCount;
        address owner;
        bool isPublic;
        uint256 createdAt;
        uint256 updatedAt;
        string storageRoot; // 0G Storage root hash
        bytes32 metadataHash; // Hash of collection metadata
    }

    struct VectorMetadata {
        string collectionId;
        string vectorId;
        string storageHash; // 0G Storage hash for vector data
        uint256 timestamp;
        bytes32 contentHash; // Hash of vector content for integrity
        mapping(string => string) attributes; // Custom metadata attributes
    }

    // Storage
    mapping(string => Collection) public collections;
    mapping(string => VectorMetadata) public vectorMetadata;
    mapping(address => string[]) public userCollections;
    mapping(string => address[]) public collectionUsers;
    mapping(string => mapping(address => bool)) public collectionAccess;

    string[] public collectionIds;
    uint256 public totalCollections;
    uint256 public totalVectors;

    // Events
    event CollectionCreated(
        string indexed collectionId,
        string name,
        address indexed owner,
        uint256 dimension
    );

    event CollectionUpdated(
        string indexed collectionId,
        string storageRoot,
        uint256 vectorCount
    );

    event VectorAdded(
        string indexed collectionId,
        string indexed vectorId,
        address indexed user,
        string storageHash
    );

    event VectorRemoved(
        string indexed collectionId,
        string indexed vectorId
    );

    event AccessGranted(
        string indexed collectionId,
        address indexed user
    );

    event AccessRevoked(
        string indexed collectionId,
        address indexed user
    );

    constructor() {
        _grantRole(DEFAULT_ADMIN_ROLE, msg.sender);
        _grantRole(ADMIN_ROLE, msg.sender);
        _grantRole(OPERATOR_ROLE, msg.sender);
        _grantRole(USER_ROLE, msg.sender);
    }

    modifier onlyCollectionOwner(string memory collectionId) {
        require(
            collections[collectionId].owner == msg.sender || 
            hasRole(ADMIN_ROLE, msg.sender),
            "VectorRegistry: Not collection owner or admin"
        );
        _;
    }

    modifier collectionExists(string memory collectionId) {
        require(
            collections[collectionId].owner != address(0),
            "VectorRegistry: Collection does not exist"
        );
        _;
    }

    modifier hasCollectionAccess(string memory collectionId) {
        require(
            collections[collectionId].isPublic ||
            collections[collectionId].owner == msg.sender ||
            collectionAccess[collectionId][msg.sender] ||
            hasRole(ADMIN_ROLE, msg.sender),
            "VectorRegistry: Access denied"
        );
        _;
    }

    /**
     * @dev Create a new vector collection
     * @param collectionId Unique identifier for the collection
     * @param name Human-readable name
     * @param description Collection description
     * @param dimension Vector dimension
     * @param isPublic Whether the collection is publicly accessible
     */
    function createCollection(
        string memory collectionId,
        string memory name,
        string memory description,
        uint256 dimension,
        bool isPublic
    ) external whenNotPaused {
        require(hasRole(USER_ROLE, msg.sender), "VectorRegistry: User role required");
        require(bytes(collectionId).length > 0, "VectorRegistry: Invalid collection ID");
        require(bytes(name).length > 0, "VectorRegistry: Invalid collection name");
        require(dimension > 0, "VectorRegistry: Invalid dimension");
        require(collections[collectionId].owner == address(0), "VectorRegistry: Collection already exists");

        Collection storage collection = collections[collectionId];
        collection.name = name;
        collection.description = description;
        collection.dimension = dimension;
        collection.vectorCount = 0;
        collection.owner = msg.sender;
        collection.isPublic = isPublic;
        collection.createdAt = block.timestamp;
        collection.updatedAt = block.timestamp;

        collectionIds.push(collectionId);
        userCollections[msg.sender].push(collectionId);
        totalCollections++;

        emit CollectionCreated(collectionId, name, msg.sender, dimension);
    }

    /**
     * @dev Update collection metadata and storage information
     * @param collectionId Collection identifier
     * @param storageRoot 0G Storage root hash
     * @param vectorCount Updated vector count
     * @param metadataHash Hash of collection metadata
     */
    function updateCollection(
        string memory collectionId,
        string memory storageRoot,
        uint256 vectorCount,
        bytes32 metadataHash
    ) external whenNotPaused collectionExists(collectionId) onlyCollectionOwner(collectionId) {
        Collection storage collection = collections[collectionId];

        uint256 vectorDiff = vectorCount > collection.vectorCount 
            ? vectorCount - collection.vectorCount 
            : collection.vectorCount - vectorCount;

        if (vectorCount > collection.vectorCount) {
            totalVectors += vectorDiff;
        } else {
            totalVectors -= vectorDiff;
        }

        collection.storageRoot = storageRoot;
        collection.vectorCount = vectorCount;
        collection.metadataHash = metadataHash;
        collection.updatedAt = block.timestamp;

        emit CollectionUpdated(collectionId, storageRoot, vectorCount);
    }

    /**
     * @dev Add vector metadata
     * @param collectionId Collection identifier
     * @param vectorId Vector identifier
     * @param storageHash 0G Storage hash for vector data
     * @param contentHash Hash of vector content
     */
    function addVectorMetadata(
        string memory collectionId,
        string memory vectorId,
        string memory storageHash,
        bytes32 contentHash
    ) external whenNotPaused collectionExists(collectionId) hasCollectionAccess(collectionId) {
        require(bytes(vectorId).length > 0, "VectorRegistry: Invalid vector ID");
        require(bytes(storageHash).length > 0, "VectorRegistry: Invalid storage hash");

        string memory vectorKey = string(abi.encodePacked(collectionId, ":", vectorId));

        VectorMetadata storage metadata = vectorMetadata[vectorKey];
        metadata.collectionId = collectionId;
        metadata.vectorId = vectorId;
        metadata.storageHash = storageHash;
        metadata.timestamp = block.timestamp;
        metadata.contentHash = contentHash;

        emit VectorAdded(collectionId, vectorId, msg.sender, storageHash);
    }

    /**
     * @dev Remove vector metadata
     * @param collectionId Collection identifier
     * @param vectorId Vector identifier
     */
    function removeVectorMetadata(
        string memory collectionId,
        string memory vectorId
    ) external whenNotPaused collectionExists(collectionId) onlyCollectionOwner(collectionId) {
        string memory vectorKey = string(abi.encodePacked(collectionId, ":", vectorId));
        delete vectorMetadata[vectorKey];

        emit VectorRemoved(collectionId, vectorId);
    }

    /**
     * @dev Grant access to a collection
     * @param collectionId Collection identifier
     * @param user User address to grant access
     */
    function grantAccess(
        string memory collectionId,
        address user
    ) external whenNotPaused collectionExists(collectionId) onlyCollectionOwner(collectionId) {
        require(user != address(0), "VectorRegistry: Invalid user address");

        collectionAccess[collectionId][user] = true;
        collectionUsers[collectionId].push(user);
        userCollections[user].push(collectionId);

        emit AccessGranted(collectionId, user);
    }

    /**
     * @dev Revoke access to a collection
     * @param collectionId Collection identifier
     * @param user User address to revoke access
     */
    function revokeAccess(
        string memory collectionId,
        address user
    ) external whenNotPaused collectionExists(collectionId) onlyCollectionOwner(collectionId) {
        collectionAccess[collectionId][user] = false;
        emit AccessRevoked(collectionId, user);
    }

    /**
     * @dev Set vector attribute
     * @param collectionId Collection identifier
     * @param vectorId Vector identifier
     * @param key Attribute key
     * @param value Attribute value
     */
    function setVectorAttribute(
        string memory collectionId,
        string memory vectorId,
        string memory key,
        string memory value
    ) external whenNotPaused collectionExists(collectionId) hasCollectionAccess(collectionId) {
        string memory vectorKey = string(abi.encodePacked(collectionId, ":", vectorId));
        vectorMetadata[vectorKey].attributes[key] = value;
    }

    // View functions

    /**
     * @dev Get collection information
     */
    function getCollection(string memory collectionId) 
        external 
        view 
        returns (Collection memory) 
    {
        return collections[collectionId];
    }

    /**
     * @dev Get vector metadata
     */
    function getVectorMetadata(string memory collectionId, string memory vectorId)
        external
        view
        returns (string memory, string memory, uint256, bytes32)
    {
        string memory vectorKey = string(abi.encodePacked(collectionId, ":", vectorId));
        VectorMetadata storage metadata = vectorMetadata[vectorKey];
        return (
            metadata.storageHash,
            metadata.collectionId,
            metadata.timestamp,
            metadata.contentHash
        );
    }

    /**
     * @dev Get vector attribute
     */
    function getVectorAttribute(
        string memory collectionId,
        string memory vectorId,
        string memory key
    ) external view returns (string memory) {
        string memory vectorKey = string(abi.encodePacked(collectionId, ":", vectorId));
        return vectorMetadata[vectorKey].attributes[key];
    }

    /**
     * @dev Get user collections
     */
    function getUserCollections(address user) external view returns (string[] memory) {
        return userCollections[user];
    }

    /**
     * @dev Get collection users
     */
    function getCollectionUsers(string memory collectionId) external view returns (address[] memory) {
        return collectionUsers[collectionId];
    }

    /**
     * @dev Get all collection IDs
     */
    function getAllCollections() external view returns (string[] memory) {
        return collectionIds;
    }

    /**
     * @dev Check if user has access to collection
     */
    function hasAccess(string memory collectionId, address user) external view returns (bool) {
        return collections[collectionId].isPublic ||
               collections[collectionId].owner == user ||
               collectionAccess[collectionId][user];
    }

    // Admin functions

    /**
     * @dev Pause contract (admin only)
     */
    function pause() external onlyRole(ADMIN_ROLE) {
        _pause();
    }

    /**
     * @dev Unpause contract (admin only)
     */
    function unpause() external onlyRole(ADMIN_ROLE) {
        _unpause();
    }

    /**
     * @dev Grant role to user (admin only)
     */
    function grantUserRole(address user) external onlyRole(ADMIN_ROLE) {
        _grantRole(USER_ROLE, user);
    }

    /**
     * @dev Get contract statistics
     */
    function getStats() external view returns (uint256, uint256, uint256) {
        return (totalCollections, totalVectors, collectionIds.length);
    }
}

